import React from 'react';
import CreateUserForm from './components/CreateUser/CreateUserForm';
import LoginForm from './components/LoginUser/LoginForm';

const App = () => {
  return (
    <div className="app-container">
      <CreateUserForm />
      <LoginForm />
    </div>
  );
};

export default App;
